import React, { Component } from 'react';

export class Form extends Component {
  render() {
    return (
      <div>
        <div classname='row row-sm'>
          <div classname='col-lg'>
            <form.control type='text' placeholder='Input box'></form.control>
          </div>
        </div>
      </div>
    );
  }
}

export default Form;
